// import logo from './logo.svg';
import './App.css';
import Header from './Header';
import Banner from './Banner';
import Music from './Music.js';
import Footer from './Footer.js';
import Headerleft from './Header_left';
import Headerleftbtm from './Header_left_btm.js';
import cheques from './songs/song.mp3';
import cheq from './images/cheques.jpeg'
const arr1 = [
  {
    thumbnail: { cheq },
    songs: { cheques },
  },
  {
    thumbnail: { cheq },
    songs: "cheques",
  },
  {
    thumbnail: { cheq },
    songs: "cheques",
  },
  {
    thumbnail: { cheq },
    songs: "cheques",
  }
]

function App() {
  return (
    <div className="App">
      <div className='Header_banner'>
        <Header />
        <div className="banner">
          {arr1.map((data) => {
            return <Banner song={data.songs} thumb={data.thumbnail} />
          })}
        </div>
        <Music />
        <Footer />
      </div>
      {/* left side */}
      <div className='all_left_side'>
        <div className='Header_banner_left'>
          <Headerleft />
        </div>
        <div className='Header_banner_left_btm'>
          <Headerleftbtm />
        </div>
      </div>
    </div>
  );
}

export default App;
